CREATE TABLE drinking_water_availability(
   region                    INTEGER  NOT NULL
  ,region_name               VARCHAR(29) NOT NULL
  ,year                      INTEGER  NOT NULL
  ,safe_drinking_water_rural NUMERIC(4,1)
  ,safe_drinking_water_total NUMERIC(4,1)
  ,safe_drinking_water_urban NUMERIC(4,1)
  ,PRIMARY KEY(region,year)
);
